import React from "react";
import { useNavigate } from "react-router-dom";
import { FaClock, FaArrowRight, FaSignOutAlt } from "react-icons/fa";
import "../Staff.css";

function StaffDashboard() {
  const navigate = useNavigate();

  const handleLogout = () => {
    // ✅ Remove stored token or user data (if you saved it)
    localStorage.removeItem("token");
    localStorage.removeItem("user");

    // ✅ Redirect to login page
    navigate("/");
  };

  return (
    <div className="staff-dashboard">
      <div className="dashboard-container">
        <h1 className="dashboard-title">Welcome Back</h1>

        <button className="dashboard-btn timein-btn">
          <FaClock /> Time - In
        </button>

        <button className="dashboard-btn checkout-btn">
          <FaArrowRight /> Check - Out
        </button>

        <button className="dashboard-btn logout-btn" onClick={handleLogout}>
          <FaSignOutAlt /> Logout
        </button>
      </div>
    </div>
  );
}

export default StaffDashboard;
